import TableRow from "./TableRow";
const InventoryTable = (props) => {
  const table = props.table;
  return (
    <table>
      <tr>
        <th>Name</th>
        <th>Batch</th>
        <th>Deal</th>
        <th>Free</th>
        <th>MRP</th>
        <th>Rate</th>
        <th>Expiry Date</th>
      </tr>
        {table.map((row)=> <TableRow tableRow={row}/>)}
    </table>
  );
};

export default InventoryTable;
